function HTML5Video() {
  var $videos = $('.JWVideo');
  if ($videos.length < 1) return;

  require(['vendor/jwplayer-7/jwplayer'], function(jwplayer) {
    $('.JWVideo').each(function(idx, elem) {
      var $elem = $(elem);
      var source = $elem.data('source');
      var width = $elem.data('videoWidth');
      var height = $elem.data('videoHeight');
      var poster = $elem.find('img').prop('src');

      jwplayer($elem.prop('id')).setup({
        stretching: "fill",
        width: width,
        height: height,
        image: poster,
        flashplayer: "/javascripts/app/vendor/jwplayer-7",
        file: source
      });
    });
  });
}


